import React, { useState } from "react";
import ReactDOM from "react-dom";
import "./index.css"

const App = () =>{

    const [listvalue, updatedval] = useState("banana");
  

    const changing = (event) =>{
        // console.log(event.target.value)
          updatedval("apple")
    }

    return(
        <>
            <div className="main_div">
                <div className="center_div">
                    <br></br>
                    <h1> ToDo List</h1>
                    <br></br>
                    <input onChange={changing} type="text" placeholder="Add an item"></input>
                    <button>+</button>

                    <ol >
                        <li >{listvalue}</li>
                    </ol>
                </div>         
            </div>
        </>
    );

}

export default App;
